class  Hello{
	def log;
	def context;
	def testRunner;

	def Hello(log, context, testRunner){
	this.log = log;	
	this.context = context;
	this.testRunner = testRunner;
	}

	def sayHello(){
		log.info ("Saying Hello");
	}

}

//Creating instance of class
context.setProperty("Hello", new Hello(log,context,testRunner));

project = testRunner.testCase.testSuite.project;

tcase = project.testSuites["CountryInfoService_TestSuite_Practice"].testCases["Groovy_Testcase"];

stepRef = tcase.getTestStepByName("OOPS");

stepRef.run(testRunner, context)

context.Hello.sayHello();

project = testRunner.testCase.testSuite.project;
tcase = project.testSuites["CountryInfoService_TestSuite_Practice"].testCases["Groovy_Testcase"];
tstep = tcase.getTestStepByName("LogHello");
tstep.run(testRunner,context);
